	add("manileño", "{\"term\":\"manileño\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Tagalog\"], \"text\":\"From Tagalog\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the ethnic group native to Manila\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Denise Weldon, Neal M Oshima, LJC Restaurant Group, \u0027Malate: a matter of taste\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Manileños\u0027\u0027 needed a break from the Imeldific extravaganzas. They hankered for a spontaneous and casual lifestyle, which they could not find in the five-star hotels...Category:English terms spelled with Ñ\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manimal", "{\"term\":\"manimal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|animal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fanciful life form that is part human and part beast; a creature recognizable as human but possessing physical or primitive behavioral characteristics that are exclusive to animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 January 1, Christopher Miles, “Kori Newkirk; the project”, \u0027Artforum International Magazine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Standing naked against a wintry landscape, the figure became a screen for the projection of identities--beast, bigfoot, \u0027\u0027manimal\u0027\u0027, specter, even, to use a word Newkirk\u0027s work encourages one to use in all its dangerousness, spook\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 February 1, Paul Z. Myers, \u0027Pharyngula\u0027, ScienceBlog\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"President panders to anti-\u0027\u0027manimal\u0027\u0027 lobby! Dr Moreau flees country in rage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 February 4, Charlie Pierce, \u0027Wait Wait... Don\u0027t Tell Me!\u0027, National Public Radi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Two years ago we were going to Mars, and that sort of didn\u0027t happen\u0027...\u0027and now there\u0027s, like, \u0027\u0027manimal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person compared to such a creature, especially an unkempt and uncivilized, or strong and sexually aggressive man\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 January 1, Michael Burnett, “Tumyeto army”, \u0027Thrasher\u0027, High Speed Productions, Inc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Layton smacked his head hard on a front feeble, but bounced back up to get the make. That kid\u0027s a \u0027\u0027manimal\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;Oh, he\u0027s so on the team,\u0026quot; Diego kept saying\", \"priority\":11}]}, \"synonyms\":{}}");

	add("maniple", "{\"term\":\"maniple\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From the Middle english (1100-1500) \u0027maniple\u0027 \u0027manyple\u0027 \u0027manaple\u0027 from the Old french (842-ca. 1400) \u0027maniple\u0027 \u0027manipule\u0027 (\u0027manipule\u0027 in Modern French , from the Latin \u0027manipulus\u0027 (handful”, “troop of soldiers) from \u0027manus\u0027 (hand) + the weakened root of \u0027pleō\u0027 (i fill)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A handful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A division of the Roman army numbering 60 or 120 men exclusive of officers, any small body of soldiers; a company\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Originally, a napkin; later, an ornamental band or scarf worn upon the left arm as a part of the vestments of a priest in the Roman Catholic Church, and sometimes worn in the English Church service\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manitou", "{\"term\":\"manitou\", \"etymology\":{\"influencers\":[], \"languages\":[\"pidgin delaware\", \"English\", \"munsee\", \"unami\"], \"text\":\"From Pidgin delaware \u0027manétto\u0027 from Unami \u0027manëtu\u0027 () ({{IPAchar|manətːu|lang\u003dunm}}) and Munsee \u0027manutoow\u0027 (later influenced by French \u0027manitou\u0027 from Montagnais); from Proto-algonquian {{m|alg-pro|*maneto·wa||supernatural being}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A god or spirit as the object of religious awe or ritual among some American Indians\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1826\u0027\u0027, James Fenimore Cooper, \u0027The Last of the Mohicans\u0027, 1888 p. 319\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If it were possible to translate the comprehensive and melodious language in which he spoke, the ode might read something like the following: \u0026quot;\u0027\u0027Manitou\u0027\u0027! Manitou! Manitou! Thou art great, thou art good, thou art wise: Manitou! Manitou! Thou art just.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, John A Grim, \u0027The Shaman\u0027, p. 143\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Each Ojibway shaman\u0027s method of communication with the \u0027\u0027manitou\u0027\u0027 patron is unique and is related to a personal dream experience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027Three Day Road\u0027, Penguin 2008, p. 43\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My father strung it high in a tree for the \u0027\u0027\u0027manitous\u0027\u0027\u0027 to watch over\", \"priority\":7}]}, \"synonyms\":{}}");

