	add("manservant", "{\"term\":\"manservant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|servant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male servant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I asked my \u0027\u0027manservant\u0027\u0027 to attend to the washing and cleaning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027 \u0027Six days thou shalt labour, and do all thy work: But the seventh day is the sabbath of the LORD thy God: in it thou shalt not do any work, thou, nor thy son, nor thy daughter, nor thy \u0027\u0027manservant\u0027\u0027, nor thy maidservant, nor thine ox, nor thine ass, nor any of thy cattle, nor thy stranger that is within thy gates; that thy \u0027\u0027manservant\u0027\u0027 and thy maidservant may rest as well as thou.\u0027 Deuteronomy 5:12-13 KJV\", \"priority\":3}]}, \"synonyms\":{}}");

	add("mansionization", "{\"term\":\"mansionization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mansion|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of demolishing smaller, older houses in a neighbourhood and replacing them with new ones that occupy the maximum amount of lot space possible and dwarf surrounding dwellings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Katherine Hall Page, \u0027The Body in the Lighthouse\u0027, Avon Books (2003), ISBN 0380813866, [http://books.google.com/books?id\u003dk71dbc2BHZYC\u0026amp;pg\u003dPA33 page 33\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Mansionization\u0027\u0027,\u0026quot; Faith said. \u0026quot;It\u0027s happening all over the country. Even in Aleford. Remember that sweet little Cape on River Street? Now it\u0027s a six-bedroom, six-and-a-half-bath Colonial on steroids, with great room, gym, home theater, and wine cellar.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manslut", "{\"term\":\"manslut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|slut|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A womanizer, lothario, a promiscuous ma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Red Jordan Arobateau, \u0027Street of dreams\u0027, [http://books.google.com/books?id\u003dxXgAglkIp9MC\u0026amp;pg\u003dPA78\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CF8Q6AEwCQ page 78\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m raping you \u0027\u0027manslut\u0027\u0027.\u0026quot; A smile of satisfaction on her lips as she rapes me with her phallus nightstick\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027Details\u0027: Volume 22, Issues 7-10, [http://books.google.com/books?id\u003ds-44AQAAIAAJ\u0026amp;q\u003dmanslut\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqvN_T_X7BOq0iQK8iu35Ag\u0026amp;ved\u003d0CD8Q6AEwAzgK link\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A zit, after all, isn\u0027ta cold sore on your lip, making you look like a diseased \u0027\u0027manslut\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Stefan G. Bucher, \u0027All Access: The Making of Thirty Extraordinary Graphic Designers\u0027, [http://books.google.com/books?id\u003djDYo4qOxFacC\u0026amp;pg\u003dRA8-PT29\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDwQ6AEwAg link\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Tommy in the novel is a pansexual pill-popping \u0027\u0027manslut\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Ryan Spear, \u0027Mikey Jr.: A Script\u0027, [http://books.google.com/books?id\u003dyGxgtoKeeAsC\u0026amp;pg\u003dPA32\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEcQ6AEwBA page 32\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You\u0027re right, before everything that happened this morningI did plan on marrying you, having children with you, and starting a family, but that was all before I found out that I\u0027m engaged to the world\u0027s biggest \u0027\u0027manslut\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Joshilyn Jackson, \u0027Backseat Saints\u0027, [http://books.google.com/books?id\u003drKNgpIpk00sC\u0026amp;pg\u003dPT43\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDYQ6AEwAQ link\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Tre is a manslut\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Emma Forest, Your Voice in My Head: A Memoir, [http://books.google.com/books?id\u003dZWKrLp_KazgC\u0026amp;pg\u003dPT134\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDAQ6AEwAA link\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"GH is an unwashed \u0027\u0027manslut\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lisa Marie Rice, \u0027Nightfire: A Protectors Novel: Marine Force Recon\u0027, [http://books.google.com/books?id\u003dzu4oxuQOLUkC\u0026amp;pg\u003dPT168\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEIQ6AEwAw link\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"For the Mike they knew, formerly known as the “\u0027\u0027manslut\u0027\u0027,” this behavior was incomprehensible\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Amy Lane, \u0027Super Sock Man\u0027, [http://books.google.com/books?id\u003dJ9QBNjhJPU4C\u0026amp;pg\u003dPA3\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEwQ6AEwBQ page 3\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"And he\u0027s a real \u0027\u0027manslut\u0027\u0027, too. He must pick up a different guy a week\", \"priority\":17}]}, \"synonyms\":{}}");

	add("mansonite", "{\"term\":\"mansonite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Manson|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A follower of w:Charles Charles Manson (born 1934), American leader of a cult-like criminal group in the 1960s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Alexander Walker, \u0027Double takes: notes and afterthoughts on the movies, 1956-76\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The glib interpretations offered — the \u0027\u0027Mansonites\u0027\u0027 were all people with grudges against society: he had, like Hitler, an incomplete personality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fan of controversial American rock musician w:Marilyn Marilyn Manson (Brian Warner, born 1969\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027SPIN\u0027 magazine (volume 10, number 6, September 1994\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Today\u0027s wet-behind-the-ears \u0027\u0027Mansonites\u0027\u0027 are fueled by the spirit of betrayal, the sense that somewhere along the line the Woodstock generation copped out\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Bhesham R. Sharma, \u0027The death of art\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"By the end, she has become a \u0027\u0027Mansonite\u0027\u0027 Goth\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Raven Digitalis, \u0027Goth Craft: The Magickal Side of Dark Culture\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For most \u0027\u0027Mansonites\u0027\u0027, Goth is only a phase, and their fashion and outlook on life change alongside Marilyn Manson\u0027s\", \"priority\":10}]}, \"synonyms\":{}}");

	add("manspreading", "{\"term\":\"manspreading\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|spreading|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of men splaying their legs open wide when sitting on public transport, thus occupying more than one seat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Emma G. Fitzsimmons, \u0026quot;[http://www.nytimes.com/2014/12/21/nyregion/MTA-targets-manspreading-on-new-york-city-subways.html?_r\u003d0 A Scourge Is Spreading. M.T.A.’s Cure? Dude, Close Your Legs]\u0026quot;, \u0027The New York Times\u0027, 20 December 2014\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The new ads — aimed at curbing rude behavior like \u0027\u0027manspreading\u0027\u0027 and wearing large backpacks on crowded trains — are set to go up in the subways next month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Margaret Wente, \u0026quot;[http://www.theglobeandmail.com/globe-debate/advice-to-younger-women-practise-manning-up/article22383707/ Advice to younger women: Practise manning up]\u0026quot;, \u0027The Globe and Mail\u0027, 10 January 2015\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Manspreading\u0027\u0027 is certainly bad manners in a crowded subway – and so is other stuff, like people wielding giant backpacks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Natasha Devon, \u0026quot;[http://www.independent.co.uk/life-style/health-and-families/features/the-rise-of-stranger-shaming-how-humiliating-others-became-acceptable-9982260.html The rise of stranger shaming: How humiliating others became acceptable]\u0026quot;, \u0027The Independent\u0027, 16 January 2015\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Twitter, Snapchat and Instagram show thousands pictures of men engaging in this behaviour, and New York\u0027s transit authority launched a campaign against \u0027\u0027manspreading\u0027\u0027, with a Tumblr dedicated: Men Taking Up Too Much Space On The Train\", \"priority\":7}]}, \"synonyms\":{}}");

	add("manstealer", "{\"term\":\"manstealer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|stealer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slave-dealer; someone who seizes another person to hold that person as a slave or sell that person into slavery; \u0027more loosely:\u0027 a slaveholder\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manteau", "{\"term\":\"manteau\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027manteau\u0027 (mantle) Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cloak or gown, especially of a kind popular with women in the 17th and 18th centuries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 915\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not to mention the need to keep her \u0027\u0027manteau\u0027\u0027 from becoming a sort of \u0027anti-parachute\u0027 which sought to lift her free of the pavement\", \"priority\":3}]}, \"synonyms\":{}}");

