	add("manticism", "{\"term\":\"manticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mantic|ism|t1\u003dpertaining to divination or prophecy|t2\u003dtendency of behaviour or action|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, “Prophecy”, essay iii in \u0027Aids to Faith\u0027, ed. w:William Thomson William Thomson, § 1, [http://books.google.co.uk/books?id\u003dFx8_AAAAYAAJ\u0026amp;pg\u003dPA81\u0026amp;dq\u003dmanticism\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJsT4U4aaEoye7Abbu4DgBA\u0026amp;ved\u003d0CCIQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dmanticism\u0026amp;f\u003dfalse page 81\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It is useless…to go to the \u0027\u0027manticism\u0027\u0027 of the heathen to get light as to the nature of Hebrew prophecy\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manticore", "{\"term\":\"manticore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Latin \u0027\u0027mantichora|mantichōra\u0027\u0027, from Greek \u0027\u0027μαντιχώρας\u0027\u0027 (\u0027mantichōras\u0027), \u0027\u0027μαρτιχόρας\u0027\u0027 (\u0027martichoras\u0027), \u0027\u0027μαρτιοχώρας\u0027\u0027 (\u0027martiochōras\u0027) \u0026quot;man-eater, tiger\u0026quot;, from Old Persian \u0027*martya-χvāra\u0027 \u0026quot;man-eater\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Persian mythology\u0027), A beast with the body of a lion (usually red), the tail of a scorpion, and the head/face of a man with a mouth filled with multiple rows of sharp teeth (like a shark), said to be able to shoot spikes from its tail or mane to paralyse prey. May be horned, winged, or both; its voice is described as a mixture of pipes and trumpets\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantit", "{\"term\":\"mantit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|tit|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man\u0027s breast, pectoral, or nipple\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantlet", "{\"term\":\"mantlet\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From \u0027mantellettum\u0027 (short mantle) and its source, Anglo-norman \u0027mantelet\u0027 Old french (842-ca. 1400) \u0027mantelet\u0027 diminutive of \u0027mantel\u0027 (mantle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short sleeveless cloak or cape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A portable screen or other covering, especially as used to protect the approach of soldiers engaged in a siege\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027A Storm of Swords\u0027, Bantam 2011, p. 947\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Already their archers were stealing forward, pushing their rolling \u0027\u0027mantlets\", \"priority\":4}]}, \"synonyms\":{}}");

	add("mantrip", "{\"term\":\"mantrip\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A for transporting down into an underground mine\", \"priority\":1}]}, \"synonyms\":{}}");

