	add("manufactory", "{\"term\":\"manufactory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|manūfactus}} {{suffix||ory|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A manufacturing process; a particular industry or part of an industry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A plant where something is manufactured; a factory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, journal, 2 Aug 1832\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We have just changed horses at Birmingham where I was two years ago and we visited the \u0027\u0027manufactories\u0027\u0027 which are very curious\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manufacturer", "{\"term\":\"manufacturer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|manufacture}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one that manufactures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manumation", "{\"term\":\"manumation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|manual|automation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Applying technology to automate a business process that produces the same results as the manual process before automation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 , Frank Sklarsky (interviewee), “DaimlerChrysler: Revving the Finance Engine”, \u0027Financial Executive\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One operating tip: \u0026quot;Always move from \u0027\u0027manumation\u0027\u0027 to automation,\u0026quot; Sklarsky advises. \u0026quot;Any time there\u0027s a piece of information, record it once. Then you can funnel it where it needs to go and let the computer do the reporting.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 April, Kalle Kangas, \u0027Business Strategies for Information Technology Management\u0027, page 179, Idea Group Inc., IRM Pres\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Indeed, without a firm connection to good external benchmarks (best practice, best-of-class indicators) companies can fall victim to \u0027\u0027\u0027manumation\u0027\u0027\u0027\u0026lt;!--italics in original--\u0026gt;, simply automating old, outdated processes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Maria A. Wimmer, ed. \u0027Electronic Government: 4th International Conference, EGOV 2005, Copenhagen, Denmark\u0027, page 5 - citing L. Mohan and W. K. Holstein, \u0027Decision support systems: an applications perspective\u0027. Albany: Unpublished draft, 1998\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In contrast, the \u0026quot;\u0027\u0027manumation\u0027\u0027\u0026quot; of processes through traditional MIS never facilitated such rapid change in strategy and structure\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, C. Cristian Wulf, \u0027CFO Insights: Enabling High Performance Through Leading Practices for Finance ERP\u0027, page v, John Wiley and Son\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"When asked about the biggest risk the organization faced with this effort, the CFO replied\u0026lt;!--no comma--\u0026gt; “\u0027\u0027Manumation\u0027\u0027. Automation of our existing manual processes.\u0026amp;nbsp;.\u0026amp;nbsp;.\u0026amp;nbsp;.\u0026lt;!--...--\u0026gt;”\", \"priority\":9}]}, \"synonyms\":{}}");

	add("manumission", "{\"term\":\"manumission\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the past participle stem of Latin {{m|la|manūmittō}} (English {{m|en|manumit}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Release from slavery or other legally sanctioned servitude; the giving of freedom; the act of manumitting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1823\u0027\u0027, \u0027The Pioneers\u0027, ch. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027manumission\u0027\u0027 of the slaves in New York has been gradual\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, \u0027Anglo-Saxon Britain\u0027, ch. 19\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In the west, and especially in Cornwall, the names of the serfs were mainly Celtic,—Griffith, Modred, Riol, and so forth,—as may be seen from the list of \u0027\u0027manumissions\u0027\u0027 preserved in a mass-book at St. Petroc\u0027s, or Padstow\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Kingdom of the Wicked\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The more innocent dreamed of a \u0027\u0027manumission\u0027\u0027 kindly bestowed by the new Emperor as one of a number of acts of justice and clemency proper to a new reign\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 Nov. 30, \u0026quot;[http://www.nytimes.com/2012/12/01/opinion/the-real-thomas-jefferson.html?_r\u003d0 The Real Thomas Jefferson: The Monster of Monticello],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 3 Aug 2015)\u0026lt;/small\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Rather than encouraging his countrymen to liberate their slaves, he opposed both private \u0027\u0027manumission\u0027\u0027 and public emancipation\", \"priority\":9}]}, \"synonyms\":{}}");

	add("manutention", "{\"term\":\"manutention\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027manutention\u0027 from Latin \u0027manutentio\u0027 (maintenance) from present participle of \u0027manutenere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Maintenance, upkeep of a person, place or thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.108\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Christian religion hath all the markes of extreme justice and profit, but none more apparent than the exact commendation of obedience due unto magistrates, and \u0027\u0027manutention\u0027\u0027 [\u0027tr\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"manutention\u0027] of policies\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manwhore", "{\"term\":\"manwhore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|whore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who has sex with clients for money; a male prostitute\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999:\u0027\u0027 Dec. 10, Michael O\u0027Sullivan, “Not Just a \u0027Gigolo\u0027”, \u0027Washington Post\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A schmo who finds love by prostituting himself is...rather sweet in a sophomoric, \u0027\u0027manwhore\u0027\u0027-with-a-heart-of-gold kind of way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 July 30, Dr. Duncan Black, “The Mob”, \u0027Eschaton\u0027, at atrios.blogspot.com [http://atrios.blogspot.com/2005_07_24_atrios_archive.html\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He lied about his past military service and had spend [\u0027sic.\u0027] recent years being a $200/hr \u0027\u0027manwhore\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Farrell Kaye, \u0027Helltown: The Adventures of the Midnight Man\u0027, page 217\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s a \u0027\u0027man-whore\u0027\u0027, Paige. He seduces women for money. He seduced you and countless married women without any care for the consequences\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A promiscuous man who has no regard for his sexual partners or the emotional value of his relationships\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 July 6, Jennifer Balderas, “Daddy\u0027s Little \u0026lt;s\u0026gt;Girl\u0026lt;/s\u0026gt; Demon” [\u0027sic.\u0027], \u0027Finding Her Life\u0027, at jennerallyspeaking.com \u0026lt;!--[http://jennerallyspeaking.com/?p\u003d65]--\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Apparently these guys are total horndogs and \u0027\u0027manwhores\u0027\u0027 and yadda yadda\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 September 18, “Dirty D.”, “Lost Romanticism and the \u0027\u0027Manwhore\u0027\u0027”, \u0027DiaryLand\u0027, at uberfrau.diaryland.com [http://uberfrau.diaryland.com/050918_66.html\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Nora and I reminisced and compared how we were treated by the \u0027\u0027manwhore\u0027\u0027 and by the nice guy\", \"priority\":12}]}, \"synonyms\":{}}");

